import { useEffect, useState } from 'react';


export default function ReceptionistDashboard() {
  const [patients, setPatients] = useState([]);
  const [showForm, setShowForm] = useState(false);
  const [name, setName] = useState('');
  const [age, setAge] = useState('');
  const [disease, setDisease] = useState('');
  const [editingId, setEditingId] = useState(null);
  const token = localStorage.getItem('token');

  useEffect(() => {
    fetch('http://localhost:8080/api/patients', {
      headers: { Authorization: `Bearer ${token}` },
    })
      .then((res) => res.json())
      .then((data) => setPatients(data));
  }, []);

  const handleSubmit = async (e) => {
    e.preventDefault();
    const data = { name, age: parseInt(age), disease };

    const url = editingId
      ? `http://localhost:8080/api/patients/${editingId}`
      : 'http://localhost:8080/api/patients';

    const method = editingId ? 'PUT' : 'POST';

    const res = await fetch(url, {
      method,
      headers: {
        'Content-Type': 'application/json',
        Authorization: `Bearer ${token}`,
      },
      body: JSON.stringify(data),
    });

    if (res.ok) {
      const result = await res.json();
      if (editingId) {
        setPatients(patients.map((p) => (p.id === result.id ? result : p)));
      } else {
        setPatients([...patients, result]);
      }
      resetForm();
    } else {
      alert('Failed to save patient');
    }
  };

  const handleDelete = async (id) => {
    const confirmDelete = window.confirm('Are you sure you want to delete this patient?');
    if (!confirmDelete) return;

    const res = await fetch(`http://localhost:8080/api/patients/${id}`, {
      method: 'DELETE',
      headers: {
        Authorization: `Bearer ${token}`,
      },
    });

    if (res.ok) {
      setPatients(patients.filter((p) => p.id !== id));
    } else {
      alert('Failed to delete patient');
    }
  };

  const resetForm = () => {
    setName('');
    setAge('');
    setDisease('');
    setShowForm(false);
    setEditingId(null);
  };

  const handleEdit = (patient) => {
    setName(patient.name);
    setAge(String(patient.age));
    setDisease(patient.disease);
    setEditingId(patient.id);
    setShowForm(true);
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-fuchsia-100 to-amber-100 p-6">
      <div className="max-w-4xl mx-auto">
        <h1 className="text-4xl font-bold text-center text-purple-700 mb-8">💼 Receptionist Dashboard</h1>

        <div className="flex justify-center mb-6">
          <button
            className="bg-blue-600 hover:bg-blue-700 text-white font-semibold px-6 py-2 rounded-xl shadow-md transition"
            onClick={() => setShowForm(!showForm)}
          >
            {showForm ? 'Cancel' : '➕ Add Patient'}
          </button>
        </div>

        {showForm && (
          <form onSubmit={handleSubmit} className="bg-white rounded-2xl shadow-lg p-6 mb-6 space-y-4">
            <input
              type="text"
              placeholder="Name"
              value={name}
              onChange={(e) => setName(e.target.value)}
              className="w-full border p-3 rounded-lg"
              required
            />
            <input
              type="number"
              placeholder="Age"
              value={age}
              onChange={(e) => setAge(e.target.value)}
              className="w-full border p-3 rounded-lg"
              required
            />
            <input
              type="text"
              placeholder="Disease"
              value={disease}
              onChange={(e) => setDisease(e.target.value)}
              className="w-full border p-3 rounded-lg"
            />
            <button
              type="submit"
              className="bg-green-500 hover:bg-green-600 text-white px-6 py-2 rounded-xl shadow transition"
            >
              {editingId ? '✅ Update Patient' : '🚀 Submit Patient'}
            </button>
          </form>
        )}

        <ul className="bg-white rounded-2xl shadow-md p-4 space-y-3">
          {patients.map((p) => (
            <li
              key={p.id}
              className="flex justify-between items-center border-b pb-2 last:border-b-0"
            >
              <div className="text-gray-800">
                <strong>{p.name}</strong> — Age: {p.age}, Disease: {p.disease || 'N/A'}
              </div>
              <div className="flex gap-2">
                <button
                  className="bg-yellow-400 hover:bg-yellow-500 text-white px-4 py-1 rounded-lg shadow"
                  onClick={() => handleEdit(p)}
                >
                  ✏️ Edit
                </button>
                <button
                  className="bg-red-500 hover:bg-red-600 text-white px-4 py-1 rounded-lg shadow"
                  onClick={() => handleDelete(p.id)}
                >
                  ❌ Delete
                </button>
              </div>
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
}
